            }}
          />
        </Form.Group>
        <Button variant="primary" type="submit" className="d-flex m-auto" onSubmit={() => {handlesSubmit()}}>
          Submit
        </Button>
      </Form>
      <div className="d-flex justify-content-center mt-4">
        <span className="text-center">Already have an account &nbsp;?</span>
        &nbsp;
        <a href="/login">Login</a>
      </div>
    </div>
  );
}

